#FoodUseTech #Talk
@CalabreSandra : " En 🇨🇵 on ne produit pas assez de pommes de terre #bio pour satisfaire la demande du marché. @CarrefourFrance et d'autres sociétés essayent de sponsoriser certains #agriculteurs français pour passer au bio "
#FoodTech #AgTech [LIEN]

#carrefour fait des pommes à cidre !
Ou pas...
@CarrefourFrance [LIEN]

Je reviens vite fait pour faire un petit coup de gueule ,j'ai vu à Carrefour 2 produits pour cheveux , un pour "cheveux normaux" et un "pour cheveux frisés" sous-entendu que les cheveux frisés ne sont pas normaux.
C'est raciste.
@CarrefourFrance [LIEN]

#Etude @KantarFR : les 🇫🇷 sont en quête de #traçabilité et d'une #consommation plus #responsable. La lutte contre le #gaspillagealimentaire : 60% 🇫🇷des la pratique déjà, et 50% veulent le faire davantage 
@leclercdrive, @geant_casino, @CarrefourFrance 
